import React, {Fragment} from "react";
import styles from "./AboutMe.module.css"

const AboutMe = () => {
    return (
        <Fragment>
            <div className={`${styles['about-me']}`}>
                <p> I started coding in early 2019 by teaching myself. As I got more and more comfortable and confident with it </p>
            </div>
        </Fragment>
    )
}

export default AboutMe
